#利用set去掉重复的行
def filter_file():
    set_line = set()
    if os.path.exists(PROXY_IP_FILE+'_temp'):
        with open(PROXY_IP_FILE+'_temp','r') as f:
            for line in f.readlines():
                print("line",line)
                set_line.add(line)
        print(type(set_line),type)
        with open(PROXY_IP_FILE,'a+') as f:
            for item in set_line:
                print("item",item)
                f.write(item)


